import React from 'react'
import '../../css/one.css'
function Header() {
    return (
        <header id="header">
            <nav class="menu">
                <a href="javascript:;">导航</a>
            </nav>
            <h1 class="logo">miaov.com</h1>
            <a class="user" href="javascript:;"></a>
        </header>
    );
}


export default Header
